import React, { Component } from 'react';
import { useHistory } from "react-router-dom"

const pagelink = () => {
    let history = useHistory()
    let queryString = history.location.search()



    return (
        console.log('url = ' + queryString)
    )
}

class PaginationComponent extends Component {


    render() {

     /* private String Prefix ;
        private int Page ;
        private int PagesCount ;
        private int ItemsPerPage ;
        private int ItemsCount ;*/

       const numrows = this.props.pagesCount;
       console.log('pagesCount = ' + numrows);
       /* const tbodyContent = [];

        for (let i = 0; i < numrows; i++) {
            tbodyContent.push(<li class="page-item"><a class="page-link" href="#">i+1</a></li>);
        }*/

        const pageNumbers = [];
        const location = useLocation()
        console.log('url = ' + location.pathname);
        for (let i = 1; i <= numrows; i++) {

            pageNumbers.push(<li class="page-item"><a class="page-link" href="#">{pagelink}</a></li>);
        }


        return (
            <nav aria-label="Page navigation example">
               
                <ul class="pagination">
                    <li class="page-item"><a class="page-link" href="#">Previous</a></li>
                    <ul class="pagination">
                        {
                            pageNumbers
                        }
                        </ul>
                    <li class="page-item"><a class="page-link" href="#">Next</a></li>
                </ul>
            </nav>
            
            
            )
    }
}

export default PaginationComponent
